import React, { useEffect, useState } from "react";
import "./Home.css";
// import ListPatients from "./ListPatients"; // Assuming this component will list patients
import { apiUrl } from "../axios";
import axios from "axios";

export default function Home() {
  const [searchData, setSearchData] = useState({});
  const [doctorList, setDoctorList] = useState([]);
  const [formValues, setFormValues] = useState({});
  const [loading, setLoading] = useState(true); // Add loading state

  useEffect(() => {
    getDoctors();
  }, []);

  const search = (e) => {
    e.preventDefault();
    setSearchData(formValues);
  };

  const onChangeHandler = (e) => {
    setFormValues({ ...formValues, [e.target.name]: e.target.value });
  };

  const getDoctors = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`${apiUrl}/doctors`);
      if (response.status === 200) {
        setDoctorList(response.data);
      }
    } catch (error) {
      console.log(error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div id="page-top">
      <header className="masthead">
        <div className="container">
          <div className="masthead-subheading text-light">Medical Management System</div>
          <div className="masthead-heading text-info">Your Health, Our Priority</div>
          <a className="btn btn-danger btn-xl text-uppercase" href="#services">
            Learn More
          </a>
        </div>
      </header>
      <form onSubmit={search}>
        <div className="container mt-3 p-5" style={{ maxWidth: "60%" }}>
          <h5>Search for Patients</h5>
          <div className="row mt-3">
            <label htmlFor="patient_id">Patient ID</label>
            <div className="col">
              <input
                onChange={onChangeHandler}
                type="text"
                name="patient_id"
                id="patient_id"
                className="form-control"
              />
            </div>
          </div>
          <div className="row mt-3">
            <label htmlFor="doctor">Select Doctor</label>
            <div className="col">
              <select
                onChange={onChangeHandler}
                name="doctor"
                className="form-control"
                id="doctor"
                disabled={loading} // Disable while loading
              >
                <option value="">SELECT</option>
                {doctorList.map((doctor, i) => (
                  <option key={i} value={doctor.id}>
                    {doctor.name}
                  </option>
                ))}
              </select>
            </div>
          </div>
          <div className="row mt-3">
            <div className="col">
              <button className="mt-3 btn btn-danger" disabled={loading}>
                {loading ? "Loading..." : "Search"}
              </button>
            </div>
          </div>
        </div>
      </form>
      <section className="page-section" id="services">
        <div className="container">
          <div className="text-center">
            <h2 className="section-heading text-uppercase">Services</h2>
            <h3 className="section-subheading text-muted">
              Comprehensive Healthcare Services.
            </h3>
          </div>
          <div className="row text-center">
            {/* Service Cards */}
          </div>
        </div>
      </section>
      <section className="page-section" id="about">
        <div className="container">
          <div className="text-center">
            <h2 className="section-heading text-uppercase">About</h2>
            <h3 className="section-subheading text-muted">
              Your Trusted Medical Partner.
            </h3>
          </div>
        </div>
      </section>
    </div>
  );
}
